Blindsides, Resilience and What Happens After the Worst Day of Your Lifeâ 
by Leigh Salesâ 
--------------â 
â 
"The day that turns life upside down usually starts like any other, but what happens the day after? Dual Walkley Award-winner Leigh Sales investigates how ordinary people endure the unthinkable."â 
â 
As a journalist, Leigh Sales also meets people in the full glare of the media who witnessed the worst moments in their lives. But a particular series of bad news reports â€“ and a frightening brush with her own mortality â€“ sent her searching for answers as to how susceptible each of us is to an incident that transforms our lives. What chances do we have of actually meeting one? -- are we most afraid of and why? And when the worst happens, then what happens next?â 
â 
Leigh talks closely with people who have faced the unthinkable in this wise and complex novel, from terrorism to natural catastrophe to simply being at the wrong place at the wrong time. Instead of wishing for broken lives, she finds resilience, optimism and even humour. Leigh beautifully condenses cutting-edge insight into how the human brain handles anxiety and sorrow and raises the questions that we so frequently overlook out of uncomfortability. She provides an unguarded account of her own struggles along the way, and what she has learned about dealing with the unpredictable blows of life.â 
â 
Soft, frank and empathetic, this book revolves around what happens when ordinary people are forced to unexpectedly discover the strength that most of us don't realise we have.â 
â 
Recommendation by student and summary adapted from the book.â 
