Diadaptasi dari novel #edensor karya Andrea Hirata, film ini melanjutkan kisah Ikal dan Lintang setelah berhasil melewati segala keterbatasan yang terbentang di depan mereka. Menuntut ilmu di Prancis, membuat mereka harus menghadapi tantangan lain yang tidak kalah sulitnya seperti ketika mereka masih di Belitong. 

Film yang sangat motivasioal ini memberiku semangat untuk terus meraih mimpi dan selalu percaya, bahwa apapun yang terjadi, selama asa itu belum binasa, apapun mimpimu, pasti akan terwujud. Nah, film ini sesuai untuk kamu yang sedang mencari semangat hidup yang hilang. Semangat!

